INSERT INTO `tbl_blogs` (`id`, `title`, `tag`, `image`, `description`, `slug`, `status`, `meta_title`, `meta_keyword`, `meta_description`, `created`, `modified`) VALUES
(2, 'Picking A Right Career Track', '', '7e666_demo2.png', 'For any individual it is a tough task to figure out an appropriate career path after finishing off the school and in this phase one must consider several factors to reach the desired level in their career. The first step towards identifying the right career path begins with realizing the strengths, available options, acquiring new skills and showcasing significant courage to take an appropriate as well as clear decisions. It can be stated that one can evolve various ways even if one is trapped in undesirable condition or in a situation where one is bound to do something that one is not willing to do. It all depends on the individual, how one handles the situation and take it in a positive direction.<br />\r\n<br />\r\n<strong>Importance of Significant Work:</strong> - Many people are bound to do things that are not fruitful for the future or improving their skills, it is recommended in such situation one must look for a quick counseling session in order to identify meaningful task. If one is involved in a task that is not rewarding then it is likely that one will be surrounded with stress. It has been observed that the ratio of success is more in the work in which one feels passionate about, as it gives the sense of contentment and one finds the work joyful to continue further.<br />\r\n<br />\r\n<strong>Developing Interest:</strong> - It is very crucial to have interest in the activities one performs in order to get high results and if someone is stacked in a mundane job then one can seek for ways to help others, searching for the various aspects of the job that can help in growing further. One must also develop a purpose and should control the activities accordingly.<br />\r\n<br />\r\n<strong>Maintaining Balance:</strong> - One should always maintain a balance between different activities of life. It is important to devote equal time period to your hobbies, friends, family and interests. An appropriate balance in life helps in the overall development of an individual. Taking a vacations, reading books and relaxing doing nothing can also help in rejuvenating from a stressful schedule of an individual.<br />\r\n<br />\r\n<strong>Achieving Milestones:</strong> - After choosing an appropriate career path one must develop small milestones towards achieving the overall target. By creating small milestones one gains confidence and significantly helps in achieving the set target. It reduces the pressure, gives you the right directions, and helps in learning effective time management strategies. Evolving various hurdles associated with the career path is also important as it will help in creating effective strategies to overcome them.<br />\r\nBy working on the above stated factors one can develop appropriate methodology to achieve set targets in an effective manner. In addition to these factors it is the hard-work, passion, determination and the zeal of a person that helps in achieving the desired target in life.', 'picking-a-right-career-track', 1, 'Post and search free jobs!', 'Career opportunities, Post your jobs, search jobs ', 'The first step towards identifying the right career path begins with realizing the strengths, available options, acquiring new skills and showcasing significant courage to take an appropriate as well as clear decisions.', '2016-06-13 14:03:14', '2019-07-26 05:07:04'),
(3, 'Steps To Consider Before Choosing A Career', '', '8d8c5_big.jpg', 'It is always beneficial to analyze and research about the career one is aiming to opt in order to know about the various pros and cons associated with the career. By identifying different pros and cons one will be able to determine whether the individual is capable of handling the job responsibilities and how well one can perform while handling all the factors that needs to be considered for execution of job requirement. Following below options will help in identifying potential career options: -<br />\r\n<strong>Assessing Yourself:</strong> <strong>-</strong> One must be aware about the strengths, weaknesses, interests, goals, talents and values one has in order to analyze which stream will best suit the individual. This is important because everyone cannot handle every career line and thus one must identify in which stream one can excel as well as will enjoy.<br />\r\n<strong>Listing Potential Career Options:</strong> - After the process of self-assessment one must list of some of the career options that one can pursue. The list should be designed in a manner that can help the individual in helping from where to begin the career search.<br />\r\n<strong>Exploring Options: -</strong> The developed list should be analyzed further and each and every career should be explored thoroughly so that can narrow the list further. One must learn the job requirements, training, courses, duties, and eligibility criteria of the selected career options and must also discover that the required resources are available easily or not.<br />\r\n<strong>Set Goals: -</strong> This is the most important part for acquiring the right career path. One must set goals for both short terms and long terms in order to achieve the overall objectives of the career. By setting short-term goals the individual helps in building the confidence by achieving small goals in timely manner and reduces the overall burden of the target set.<br />\r\n<strong>Create Action Plan: -</strong> For each decided goal one must develop an effective action plan so that it can help in overcoming the various hurdles that arises in achieving the opted career path. The plan should consist the strategy about how one will get the required training, education, obtain employment and develop professionally to be eligible for the job associated with the career opted.<br />\r\nThe above stated measures can be helpful in choosing the right career path, if opted in an appropriate manner. With the help of industry experts one can easily get required assistance in achieving the above stated measures in an efficient manner.', 'steps-to-consider-before-choosing-a-career', 1, 'Jobs in India, search free jobs in India. ', 'Jobs in india, Search jobs in indai, Post jobs in india, career opportunities', 'It is always beneficial to analyze and research about the career one is aiming to opt in order to know about the various pros and cons associated with the career. By identifying different pros and cons one will be able to determine whether the individual is capable of handling the job responsibilities and how well one can perform while handling all the factors that needs to be considered for execution of job requirement. ', '2016-06-12 14:06:15', '2016-06-14 06:06:03'),
(4, 'How To Write Your Resume Professionally', '', '', 'In this competitive world it is essential to have a sound personality to shine in the crowd and in the present scenario an individual&rsquo;s face is its resume, which is the first medium to make a strong impression on the recruiter. An individual should be aware of the recent trends that are prevalent in the corporate world in order to carve the resume in an efficient manner.<br />\r\n<br />\r\nEither you are a fresher or an experienced professional it is important that your resume should be able to highlight the key factors of your profile in order to attract the recruiter in an appropriate manner. The following factors may help individual in constructing their resume in an efficient manner: -<br />\r\n<br />\r\n<strong>Appropriate Introduction</strong>: -&nbsp; A brief introduction about your profile at the beginning will help the recruiter in identifying the profile in which you may best suit according to the requirement of the organization.<br />\r\n<br />\r\n<strong>Objective: -</strong> Your overall objective will again help the recruiter in analyzing whether your objectives can be used in an appropriate manner to cater the overall objective of the company.<br />\r\n<br />\r\n<strong>Summary: -</strong> The summary of your qualification is one of the key factor that plays a crucial role in selection process and thus it should be done in an appropriate and smart manner, as many recruiter make their decision by looking at the qualification an individual has.<br />\r\n<br />\r\n<strong>Work Experience: -</strong> If you are applying for a experienced profile then describing your prior experience is vital as by analyzing your work profile company gets an idea whether you will be able to handle the current job requirement or not. What sort of training will be required to groom you will be also decided by analyzing work experience of an individual.<br />\r\n<br />\r\n<strong>Highlighting Achievements: -</strong> By describing your achievements, you give further reasons to the recruiter to hire you and explains why you are worth hiring.<br />\r\n<br />\r\n<strong>Listing Education: -</strong> This is again a key factor and should be done in a smart manner. Describing education in a short and attractive manner is the key to give a quick background about your education, as recruiters don&rsquo;t want to waste their time in reading a long description about your profile.<br />\r\n<br />\r\nIn addition to the above stated factors highlighting the additional services, skills that you possess will again act as a cherry on the cake and if these basic factors are addressed in an appropriate manner then it is likely that you will end up with a proficient resume.', 'how-to-write-resume-professionally', 1, 'How To Write Your Resume Professionally.', 'career opportunities, career in india, jobs in india', 'Find career opportunities in india. Search and post free Jobs according to your skills.', '2016-06-13 14:08:10', '2018-10-07 19:04:40'),
(5, 'How to be successful?', '', '1af69_24-Education.png', 'Test', 'how-to-be-successful', 0, '', '', '', '2020-08-19 06:08:09', '2020-08-19 06:08:09');
