INSERT INTO `tbl_cover_letters` (`id`, `user_id`, `title`, `description`, `created`, `modified`) VALUES
(36, 862, ' Applicant', 'This letter is to express my interest in your posting on job site for an experienced Software Developer. With a Bachelors degree in Computer Science, Masters degree in Information Technology, and hands-on experience using .php  languages to create and implement software applications, I am confident I will be an asset to your organization.\r\n\r\nI enjoy being challenged and engaging with projects that require me to work outside my comfort and knowledge set, as continuing to learn new languages and development techniques are important to me and the success of your organization.\r\n\r\nIve attached a copy of my resume that details my projects and experience in software development. I can be reached anytime via my cell phone, 555-555-5555 or via email at greek3@email.com.\r\n\r\nThank you for your time and consideration. I look forward to speaking with you about this opportunity.\r\n\r\n', '2020-08-21 06:28:46', '2020-08-21 06:28:46'),
(37, 866, 'Applicant', 'I am writing to express my interest in the Accounting Specialist position at Crane & Jenkins. When I read the job description, I was excited to apply since I have visited the facility and highly admire the care Crane & Jenkins provides to the chronically ill and disabled youth of the community. I believe the job duties listed align well with my skills. You need someone who is highly organized and effective and who can remain positive and pleasant under strict deadlines. I believe my experience and education serves me well for this role.\r\n\r\nIn my previous capacity as a Staff Accountant at River Tech, I accurately maintained multiple ledgers within Quickbooks while self-managing multiple projects and learning new concepts regularly under deadlines. I was responsible for compiling the company\'s financial statements for the purposes of providing it to the auditor. I acted as the liaison between the external audit team and the internal accounting department.\r\n\r\nI have also worked in several customer service roles over the years prior to receiving my post-secondary education, allowing me to develop excellent communication and conflict resolution skills. I am proficient in accounting software including, but not limited to, MS Excel, Word, PowerPoint, and various other tax and accounting software.\r\n\r\nSincerely,\r\nBrayden', '2020-08-21 07:40:50', '2020-08-21 07:40:50'),
(38, 867, 'Steffin Applicant', 'I am submitting my resume for the position of QA Tester. As a skilled and highly educated professional with 3.9 years of experience testing Web-based applications, I am confident of my ability to make a significant contribution to your organization. \r\n\r\nMy professional experience includes analyzing the business requirements, creating test strategies, and executing tests to identify bugs in new software and create and maintain automation packs for the same.  \r\n\r\nWith my educational background and my attention to detail and performance, I am in an excellent position to help your organization to produce top-quality software products.   \r\n\r\nThe following are some Skills and highlights of my qualifications and experience: \r\n\r\n- Working experience on Selenium WebDriver using Java for UI testing. \r\n- Working Knowledge of tools like JIRA, Hp ALM, and Hp QC \r\n- Experience in Maven, Jenkins \r\n- UI Testing \r\n- Experienced all phases of  Agile and Waterfall models. \r\n- Frameworks using TestNG (Page object Model, Data-Driven, Page Factory, etc. ) \r\n- Git and GitHub knowledge. \r\n- Blackbox Testing (System, System Integration, Smoke, Sanity, Regression, Ad-hoc) \r\n- Complete knowledge of SDLC and STLC and Bug life cycle. \r\n- Team Leading experience \r\n- Basic Knowledge of Rest API(Postman) \r\n\r\nMy keen knowledge of software testing, review, and validationalong with my ability to think of innovative solutions and present them to clientswill allow me to bring much value to your organization. I look forward to discussing this position and my qualifications with you. \r\n\r\nThank you for your consideration. \r\n\r\nRegards, \r\nSteffan johanson\r\n', '2020-08-21 07:51:03', '2020-08-21 07:51:03'),
