(18, 'send_mail_to_candidate', 'Information Regarding Job Apply', 'Information Regarding Job Apply', '[!username!], [!MESSAGE!], [!DATE!], [!HTTP_PATH!], [!SITE_TITLE!], [!SITE_LINK!], [!SITE_URL!], [!subject!]', '<!-- Begin Middle Content -->\n<table width="100%">\n    <tbody>\n        <tr>\n            <td style="color:#434343; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;"><b style="color:#000000;">Dear</b> [!username!],</td>\n        </tr>\n        <tr>\n            <td style="color:#434343; font-size:13px; line-height:18px;">\n            <p style="color:#434343; margin:10px 0 0;">An employer send you the mail regarding to Job on [!SITE_TITLE!]. Here is the detail:-</p>\n	<p style="color:#434343; margin:10px 0 0;">Job Title : [!job!]</p>\n 	<p style="color:#434343; margin:10px 0 0;">Company Name : [!company!]</p>\n            <p style="color:#434343; margin:10px 0 0;">Company Email : [!company_email!]</p>\n 	 <p style="color:#434343; margin:10px 0 0;">Subject : [!subject!]</p>\n            <p style="color:#434343; margin:10px 0 0;">Message : [!MESSAGE!]</p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n<!-- End Middle Content -->', 'Information Regarding Job Apply', '<!-- Begin Middle Content -->\n<table width="100%">\n    <tbody>\n        <tr>\n            <td style="color:#434343; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;"><b style="color:#000000;">Dear</b> [!username!],</td>\n        </tr>\n        <tr>\n            <td style="color:#434343; font-size:13px; line-height:18px;">\n            <p style="color:#434343; margin:10px 0 0;">An employer send you the mail regarding to Job on [!SITE_TITLE!]. Here is the detail:-</p>\n	<p style="color:#434343; margin:10px 0 0;">Job Title : [!job!]</p>\n 	<p style="color:#434343; margin:10px 0 0;">Company Name : [!company!]</p>\n            <p style="color:#434343; margin:10px 0 0;">Company Email : [!company_email!]</p>\n 	 <p style="color:#434343; mar