(35, 'user_report_feedback', 'Feedback by User', 'You have received a feedback from user on [!SITE_TITLE!]', '[!SITE_TITLE!], [!name!], [!user_email!], [!contact!], [!message!],[!created!], \'[!SITE_TITLE!]\', \'[!SITE_LINK!]\', \'[!SITE_URL!]\', \'[!DATE!]\', \'[!HTTP_PATH!]\',\'[!CURRENT_URL!]\'', '<!-- Begin Middle Content -->\n<table width="100%">\n    <tbody>\n        <tr>\n            <td style="color:#434343; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;"><b style="color:#000000;">Dear</b> Admin,</td>\n        </tr>\n        <tr>\n            <td style="color:#434343; font-size:13px; line-height:18px;">\n            <p style="color:#434343; margin:10px 0 0;">An user send a feedback on [!SITE_TITLE!].  Feedback details are below:-</p>\n\n<p>Username : <b>[!name!]</b></p>\n<p>Email : <b>[!user_email!]</b></p>\n<p>Contact : <b>[!contact!]</b></p>\n<p>Message : <b>[!message!]</b></p>\n<p>Url : <b>[!CURRENT_URL!]</b></p>\n<p>Posted date : <b>[!created!]</b></p>\n          </td>\n        </tr>\n    </tbody>\n</table>\n<!-- End Middle Content -->', 'You have received a feedback from user on [!SITE_TITLE!]', '<!-- Begin Middle Content -->\n<table width="100%">\n    <tbody>\n        <tr>\n            <td style="color:#434343; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;"><b style="color:#000000;">Dear</b> Admin,</td>\n        </tr>\n        <tr>\n            <td style="color:#434343; font-size:13px; line-height:18px;">\n            <p style="color:#434343; margin:10px 0 0;">An user send a feedback on [!SITE_TITLE!].  Feedback details are below:-</p>\n\n<p>Username : <b>[!name!]</b></p>\n<p>Email : <b>[!user_email!]</b></p>\n<p>Contact : <b>[!contact!]</b></p>\n<p>Message : <b>[!message!]</b></p>\n<p>Url : <b>[!CURRENT_URL!]</b></p>\n<p>Posted date : <b>[!created!]</b></p>\n          </td>\n        </tr>\n    </tbody>\n</table>\n<!-- End Middle Content -->', 'You have received a feedback from user on [!SITE_TITLE!]