(39, 'job_alert-criteria', 'Job Alert', 'You have received Job alert from [!SITE_TITLE!]', '[!email!],[!SITE_TITLE!], [!Job_TITLE!], [!category!], [!location!], [!skill!], [!designation!], [!min_experience!], [!max_experience!], [!min_salary!] , [!max_salary!], [!description!], [!company_name!], [!contact_number!], [!website!], [!address!],[!use', '<!-- Begin Middle Content -->\r\n<table width="100%">\r\n    <tbody>\r\n        <tr>\r\n            <td style="color:#434343; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;"><b style="color:#000000;">Dear</b> [!username!],</td>\r\n        </tr>\r\n        <tr>\r\n            <td style="color:#434343; font-size:13px; line-height:18px;">\r\n            <p style="color:#434343; margin:10px 0 0;">Your have received job alert from [!SITE_TITLE!] according to your search criteria. Job details are below:-</p>\r\n\r\n<p><b>Job Title :</b> [!Job_TITLE!]</p>\r\n<p><b>Category :</b> [!category!]</p>\r\n<p><b>Location :</b> [!location!]</p>\r\n<p><b>Skill :</b> [!category!]</p>\r\n<p><b>Designation :</b> [!designation!]</p>\r\n<p><b>Required experience :</b> [!min_experience!] - [!max_experience!]</p> \r\n<p><b>Salary :</b> [!min_salary!] - [!max_salary!]</p>  \r\n<p><b>Description :</b> [!description!]</p>\r\n\r\n<p>Company Details are below:-</p>\r\n<p><b>Company name :</b> [!company_name!]</p>\r\n<p><b>Contact Number :</b> [!contact_number!]</p>\r\n<p><b>Website :</b> [!website!]</p>\r\n<p><b>Address :</b> [!address!]</p>\r\n          </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<!-- End Middle Content -->', 'You have received Job alert from [!SITE_TITLE!]', '<!-- Begin Middle Content -->\r\n<table width="100%">\r\n    <tbody>\r\n        <tr>\r\n            <td style="color:#434343; font:bold 15px Arial, Helvetica, sans-serif; margin:0; padding:10px 0 0;"><b style="color:#000000;">Dear</b> [!username!],</td>\r\n        </tr>\r\n        <tr>\r\n            <td style="color:#434343; font-size:13px;