(212, 314, 0, 'JOB8811598013225', 881, 0, 'Gold', 'Automobile engineer', 5, 33, '178', '117', NULL, 'California, USA', 0, 1, '', '<ul>\r\n	<li>Understands automobiles by studying characteristics, capabilities, and features; comparing and contrasting competitive models; inspecting automobiles.</li>\r\n	<li>Develops buyers by maintaining rapport with previous customers; suggesting trade-ins; meeting prospects at community activities; greeting drop-ins; responding to inquiries; recommending sales campaigns and promotions.</li>\r\n	<li>Qualifies buyers by understanding buyer&#39;s requirements and interests; matching requirements and interests to various models; building rapport.</li>\r\n	<li>Demonstrates automobiles by explaining characteristics, capabilities, and features; taking drives; explaining warranties and services.</li>\r\n	<li>Closes sales by overcoming objections; asking for sales; negotiating price; completing sales or purchase contracts; explaining provisions; explaining and offering warranties, services, and financing; collects payment; delivers automobile.</li>\r\n	<li>Provides sales management information by completing reports.</li>\r\n</ul>\r\n', 'Automonile private limited', 1, 'loona', '5827419632', 0, '', 0, 0, '', '', '', '0000-00-00', 'automobile-engineer', 1, 0, '2020-08-21 12:33:45', '2020-08-21 12:33:45', 2, 180.00, 'e67d0_download--9-.png', 1641234600, NULL, NULL, '', NULL, NULL, 1598013225, 509, 84, 0, NULL, NULL, 0, '', '0', 2, 5, 20000, 25000, '', '', '', '', '', '', '', '', '<strong>Automonile private limited</strong>&nbsp;is one of the leading names in Automobiles dealership of Maruti Suzuki. Prem Motors Pvt. Ltd. a company incorporated under the Companies Act having its registered office at Kanwal Complex, A G Office Road, US came into existence as a Private Limited Company on 28th&nbsp;November, 1990. Mr. Charanjeet Nagpal is the main promoter of Automonile private limited. who established the organization in the year 1990 when he acquired a dealership of Rajdoot Motorcycles, formerly a proprietary firm called &ldquo;Automonile private limited&rdquo;. With the motto of Customer Satisfaction,&nbsp;', NULL, NULL, NULL, NULL, 0, 0, 0, '36.778261', '-119.4179324'),
