(224, 305, 0, 'JOB8721598247590', 872, 0, 'Gold', 'SR.Physician', 1, 26, '38', '60', NULL, 'Jarocin, Poland', 0, 1, '', '<ul>\r\n	<li>Promotes and maintains patient health by providing medical services under the supervision of a physician.</li>\r\n	<li>Contributes to a physician&rsquo;s efficiency by identifying short-term and long-range patient care issues.</li>\r\n	<li>Recommends options and courses of action for patient care.</li>\r\n	<li>Implements physician directives.</li>\r\n	<li>Assesses patient health by interviewing patients and performing physical examination including obtaining, updating, and studying medical histories.</li>\r\n	<li>Determines abnormal conditions by administering or ordering diagnostic tests, such as X-rays and laboratory studies and interpreting test results.</li>\r\n</ul>\r\n', 'Medico', 2, 'Hansen', '6547891235', 0, '', 0, 0, '', '', '', '0000-00-00', 'sr-physician', 1, 0, '2020-08-24 05:39:00', '2020-10-06 06:24:21', 2, 180.00, 'b8c25_general-physician.jpg', 1641234600, NULL, NULL, '', NULL, NULL, 1598247590, 4459, 151, 0, NULL, NULL, 0, '', '0', 5, 7, 15000, 20000, '', '', '', '', '', '', '', '', 'These envisioned words of Mr. john, our Chairman and Managing Director, reflect the extreme passion and enthusiasm that drives the organization.<br />\r\nMarksans Pharma, headquartered at&nbsp; is a global pharmaceutical company. We are actively engaged in R&amp;D and offer CRAMS to global pharmaceutical companies.', NULL, NULL, NULL, NULL, 0, 0, 0, '51.9724492', '17.5019414'),
