INSERT INTO `tbl_pages` (`id`, `static_page_heading`, `static_page_title`, `static_page_description`, `status`, `static_page_title_de`, `static_page_description_de`, `static_page_title_fra`, `static_page_description_fra`) VALUES
(1, 'about-us', 'About Us', '<p>We give you all the tools you need to easily find right candidates for your company or work.</p>\r\n<p>Create your company profile and post jobs and find right candidate. We make it easily for you to find candidates by providing useful search and filter options.</p>\r\n<p>Received applications on your job? Notify candidates about their application status by changing status from the app only. Want to send custom email to all or single candidate? Just use this app and let us do all the work.</p>', 1, 'About us German', '<p>&nbsp;about us&nbsp; German</p>', 'About us', '<p>We give you all the tools you need to easily find right candidates for your company or work.</p>\r\n<p>Create your company profile and post jobs and find right candidate. We make it easily for you to find candidates by providing useful search and filter options.</p>\r\n<p>Received applications on your job? Notify candidates about their application status by changing status from the app only. Want to send custom email to all or single candidate? Just use this app and let us do all the work.</p>'),
(2, 'terms-and-conditions', 'Terms and Conditions', '<p>Thanks for choosing LS Employer (&quot;LS Employer&quot;, &quot;we&quot;, &quot;us&quot;, &quot;our&quot;). By using the LS Employer website or mobile application, including by purchasing Plans, you are entering into a binding contract with our local company in your country of residence (&quot;India&quot;) if applicable or the company listed in the chart.</p>\r\n<p>Your agreement with us includes these Terms and Conditions of Use. If you don\'t agree with these Terms, then please don\'t use the Service.</p>', 1, 'Terms and Conditions', '<p>Terms and Conditions</p>', 'Terms and Conditions', '<p>Thanks for choosing LS Employer (&quot;LS Employer&quot;, &quot;we&quot;, &quot;us&quot;, &quot;our&quot;). By using the LS Employer website or mobile application, including by purchasing Plans, you are entering into a binding contract with our local company in your country of residence (&quot;India&quot;) if applicable or the company listed in the chart.</p>\r\n<p>Your agreement with us includes these Terms and Conditions of Use. If you don\'t agree with these Terms, then please don\'t use the Service.</p>'),
(3, 'privacy-policy', 'Privacy Policy', '<p>This page informs you of our policies regarding the collection ,use,and disclouser of personal data when you use our service and the choice you have associated with that data.&nbsp;</p>\r\n<p><strong><big>Personal Data:</big></strong><span style="font-family: Arial;">while using our services,we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you (&quot;personal data &quot;).Personally identifiable information may include ,but is not imited to.</span></p>\r\n<ul>\r\n    <li><span style="font-family: Arial;">Email Address</span></li>\r\n    <li><span style="font-family: Arial;">Cookies and Usage data</span></li>\r\n</ul>\r\n<p><span style="font-family: Arial;">&nbsp;<big><strong>Security Of Data</strong>:</big></span><span style="font-family: Arial;">The security of your data is important to us,but remember that no method of transmission over the internet,or method of electronic storage is 100%secure.While we strive to use commercially acceptable means to protect your personal Data.</span></p>\r\n<p><strong><big>Service Provider:</big></strong><span style="font-family: Arial;">We may employ third party companies and individuals to facilitate our service to provide the service on our behalf,to perform service related services or to assist us in analyzing how our service is used.</span></p>\r\n<p><span style="font-family: Arial;">These third parties have access to your personal data only to perform these task on our behalf and are obligated not to disclose or use it for any other purpose</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 'Privacy Policy', '<p>Privacy Policy</p>', 'Privacy Policy', '<p><span style="font-family: Arial;"><big><span style="color: rgba(0, 0, 0, 0.87); letter-spacing: 0.2px;">We collect information to provide better services to all our users &mdash; from figuring out basic stuff like who you are, which language you speak.&nbsp;The information we collects, and how that information is used, depends on how you use our services and how you manage your privacy controls.</span> When you&rsquo;re not signed in, we store the information we collect with&nbsp;</big></span><span style="-webkit-tap-highlight-color: transparent; color: rgba(0, 0, 0, 0.87); line-height: 24px; border-bottom: 1.5px solid rgb(123, 170, 247); font-family: Arial;"><a class="g1mG8c" href="https://policies.google.com/privacy#footnote-unique-id" data-name="unique-id" jsaction="click:IPbaae(preventDefault=true)" style="-webkit-tap-highlight-color: transparent; text-decoration-line: none; color: rgba(0, 0, 0, 0.87); line-height: 24px; border-bottom: 1.5px solid rgb(123, 170, 247);"><big>unique identifier</big></a></span><span style="font-family: Arial;"><big><span style="-webkit-tap-highlight-color: transparent; color: rgba(0, 0, 0, 0.87); line-height: 24px; border-bottom: 1.5px solid rgb(123, 170, 247);">s</span>&nbsp;tied to the </big></span><big><a class="g1mG8c" href="https://policies.google.com/privacy#footnote-device" data-name="device" jsaction="click:IPbaae(preventDefault=true)" style="-webkit-tap-highlight-color: transparent; text-decoration-line: none; color: rgba(0, 0, 0, 0.87); line-height: 24px; border-bottom: 1.5px solid rgb(123, 170, 247);"><span style="font-family: Arial;">device</span></a></big><span style="font-family: Arial;"><big>&nbsp;you&rsquo;re using. This helps us do things like maintain your language preferences across browsing devices.</big></span></p>\r\n<p>&nbsp;</p>'),
(4, 'how-it-works', 'How it Works', '<p>Below are the steps describing our flow of work:</p>\r\n<p>1. After registering and loging into the app you can access access application functioanlities from dashbaord or by the side menu.</p>\r\n<p>2. After posting a job all the filtered candidates will be notified.</p>\r\n<p>3. When any user will apply on any job, you will be notified through the app.</p>\r\n<p>4. You can check the list of all the candidates and can change the status of there application status from the app.</p>\r\n<p>5. You can select one or more candidates at a time and send an email to them.</p>\r\n<p>&nbsp;</p>\r\n<p><font style="vertical-align: inherit;"><font style="vertical-align: inherit;">TESTEN from anand</font></font></p>', 1, 'How it Works', '<p>How it Works</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><font style="vertical-align: inherit;"><font style="vertical-align: inherit;">TEEDDFFFGFTTGHGHHHHHHH</font></font></p>', 'How it Works', '<p>Below are the steps describing our flow of work:</p>\r\n<p>1. After registering and loging into the app you can access access application functioanlities from dashbaord or by the side menu.</p>\r\n<p>2. After posting a job all the filtered candidates will be notified.</p>\r\n<p>3. When any user will apply on any job, you will be notified through the app.</p>\r\n<p>4. You can check the list of all the candidates and can change the status of there application status from the app.</p>\r\n<p>5. You can select one or more candidates at a time and send an email to them.</p>\r\n<p>&nbsp;</p>\r\n<p><font style="vertical-align: inherit;"><font style="vertical-align: inherit;">TESTEN from anand</font></font></p>'),
(5, 'media', 'Media', '<p>Media</p>', 1, 'Media', '<p>Media</p>', 'Media', '<p>Media</p>'),
(6, 'faq', 'Faq', '<p><span style="font-size: medium;"><small><strong><font color="#464645" face="Helvetica Neue, Helvetica, Arial, sans-serif">Download and Installation</font></strong></small></span></p>\r\n<p>You can download the app from Apple App store on your device. Apple is available only on Apple App store for both iPhone and iPad devices.</p>\r\n<p><span style="font-size: medium;"><span style="font-family: Arial;"><small><strong>Login and Registering</strong></small></span></span></p>\r\n<p>You can login into the app by registering and by providing your basic informations. This information will never be used without your permission.</p>\r\n<p><span style="font-size: small;"><span class="faq-question-label" style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif; font-weight: 700;">Q:&nbsp;</span></span><strong><span style="font-size: small;"><span datatype="" property="dc:title" style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif;">What can I do so that multiple employers will contact me?</span></span></strong><span style="font-size: small;"><span class="faq-answer-label" style="font-weight: 700; float: left; margin-right: 0.5em;"><br />\r\n</span></span></p>\r\n<p>A:Ensure that you complete and update your online CV profileYou should also upload your in ms word and pdf format.</p>\r\n<p><strong><span style="font-size: small;"><span style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif;">Q:How do I search for job adverts on the jobs portal?</span></span></strong></p>\r\n<p>A:Use our job search filter on the nav bar of the page .This option lets you filter the job adverts by location,category/subcategory .after selecting your preferences click on the &quot;<strong>Find Jobs</strong> &quot; button</p>\r\n<p><font color="#333333" face="Arial, sans-serif">The other option is to type the keyword yoy want to search by into the text box under job keyword search click on &quot;Find jobs&quot; after you have typed in your keywordes</font></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style="font-size: medium;">&nbsp;</span></p>\r\n<div class="field field-name-field-detailed-question field-type-text-long field-label-hidden view-mode-full" style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif; font-size: 15.008px;">\r\n<div class="field-items">\r\n<div class="field-item even">&nbsp;</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 1, 'Faq', '<p>Faq</p>', 'Faq', '<p><span style="font-size: medium;"><small><strong><font color="#464645" face="Helvetica Neue, Helvetica, Arial, sans-serif">Download and Installation</font></strong></small></span></p>\r\n<p>You can download the app from Apple App store on your device. Apple is available only on Apple App store for both iPhone and iPad devices.</p>\r\n<p><span style="font-size: medium;"><span style="font-family: Arial;"><small><strong>Login and Registering</strong></small></span></span></p>\r\n<p>You can login into the app by registering and by providing your basic informations. This information will never be used without your permission.</p>\r\n<p><span style="font-size: small;"><span class="faq-question-label" style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif; font-weight: 700;">Q:&nbsp;</span></span><strong><span style="font-size: small;"><span datatype="" property="dc:title" style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif;">What can I do so that multiple employers will contact me?</span></span></strong></p>\r\n<p><span style="font-size: small;"><span class="faq-answer-label" style="font-weight: 700; float: left; margin-right: 0.5em;"><br />\r\n</span></span></p>\r\n<p>A:Ensure that you complete and update your online CV profileYou should also upload your in ms word and pdf format.</p>\r\n<p><strong><span style="font-size: small;"><span style="color: rgb(51, 51, 51); font-family: &quot;helvetica neue&quot;, Arial, sans-serif;">Q:How do I search for job adverts on the jobs portal?</span></span></strong></p>\r\n<p>A:Use our job search filter on the nav bar of the page .This option lets you filter the job adverts by location,category/subcategory .after selecting your preferences click on the &quot;<strong>Find Jobs</strong>&nbsp;&quot; button</p>\r\n<p><font color="#333333" face="Arial, sans-serif">The other option is to type the keyword yoy want to search by into the text box under job keyword search click on &quot;Find jobs&quot; after you have typed in your keywordes</font></p>\r\n<p>&nbsp;</p>'),
