(8, 'companies', 'Companies', '<p>Companies</p>\r\n<p>Here all types companies available for recruitement</p>', 1, 'Companies', '<p>Companies</p>', 'Companies', '<p>Companies</p>'),
(9, 'career-tools', 'Career Tools', '<p><big><font color="#464645" face="Helvetica Neue, Helvetica, Arial, sans-serif"><span style="font-size: 15.5px;">To achieve a good position in your career better tools help you like no other. Below is the list of such resources which will help you in getting your dream job:</span></font><br />\r\n</big><span style="font-family: Arial;"><big>Careers here boost careers everywhere:</big></span></p>\r\n<p>We build products to connect tech professionals with the careers they desire and employer with the talent the need .Passion for helping people thrive drives all of our 500+ employees worldwide spanning Des Moines,New York,London,Singapor,HongKong,UK...etc</p>\r\n<p>&nbsp;1. After registering and loging into the app you can access access application functioanlities from dashbaord or by the side menu.</p>\r\n<p>2. After posting a job all the filtered candidates will be notified.</p>\r\n<p>3. When any user will apply on any job, you will be notified through the app.</p>\r\n<p>4. You can check the list of all the candidates and can change the status of there application status from the app.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<h3 class="color--brand" style="box-sizing: inherit; margin: 0px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-weight: inherit; font-stretch: inherit; font-size: 2.4rem; line-height: inherit; font-family: &quot;Helvetica neue lt std&quot;, &quot;Helvetica neue&quot;, Helvetica, Arial, sans-serif; vertical-align: baseline; color: rgb(14, 50, 103);">&nbsp;</h3>\r\n<p>&nbsp;</p>', 1, 'Career Tools', '<p>Career Tools</p>\r\n<p><span style="font-size: 15.5px; color: rgb(70, 70, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;">To achieve a good position in your career better tools help you like no other. Below is the list of such resources which will help you in getting your dream job:</span></p>\r\n<p><span style="font-family: Arial;"><big>&nbsp;</big><strong><big>Careers here boost careers everywhere:</big></strong></span></p>\r\n<p>We build products to connect tech professionals with the careers they desire and employer with the talent the need .Passion for helping people thrive drives all of our 500+ employees worldwide spanning Des Moines,New York,London,Singapor,HongKong,UK...etc</p>\r\n<p><span style="font-family: Arial;"><big><span style="text-indent: -0.25in; font-size: 10pt;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;">&nbsp;</span></span><span style="text-indent: -0.25in; font-size: 9pt;">We are a mission -driven organization ,connecting professionals with careers that further theire lives</span></big></span></p>\r\n<p class="MsoListParagraph" style="text-indent: -0.25in; line-height: normal;"><span style="font-size: 9pt; font-family: Arial, sans-serif;"><o:p></o:p></span></p>\r\n<p>&nbsp;1. After registering and loging into the app you can access access application functioanlities from dashbaord or by the side menu.</p>\r\n<p>2. After posting a job all the filtered candidates will be notified.</p>\r\n<p>3. When any user will apply on any job, you will be notified through the app.</p>\r\n<p>&nbsp;</p>', 'Career Tools', '<p><span style="font-size: 15.5px; color: rgb(70, 70, 69); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif;">To achieve a good position in your career better tools help you like no other. Below is the list of such resources which will help you in getting your dream job:</span></p>\r\n<p><span style="font-family: Arial;"><big>&nbsp;Careers here boost careers everywhere:</big></span></p>\r\n<p>We build products to connect tech professionals with the careers they desire and employer with the talent the need .Passion for helping people thrive drives all of our 500+ employees worldwide spanning Des Moines,New York,London,Singapor,HongKong,UK...etc</p>\r\n<p><span style="text-indent: -0.25in; font-size: 10pt; font-family: Symbol;"><span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;</span></span><span style="font-family: Arial;"><big><span style="text-indent: -0.25in; font-size: 9pt;">We are a mission -driven organization ,connecting professionals with careers that further theire lives</span></big></span></p>\r\n<p class="MsoListParagraph" style="text-indent: -0.25in; line-height: normal;"><span style="font-size: 9pt; font-family: Arial, sans-serif;"><o:p></o:p></span></p>\r\n<p>&nbsp;1. After registering and loging into the app you can access access application functioanlities from dashbaord or by the side menu.</p>\r\n<p>2. After posting a job all the filtered candidates will be notified.</p>\r\n<p>3. When any user will apply on any job, you will be notified through the app.</p>\r\n<p>&nbsp;</p>'),
