(13, 'career-resources', 'Career Resources', '<p><span style="color: rgb(63, 63, 63); font-family: roboto, sans-serif; font-size: 16px;">LogicSpice provides a platform to show the skills of the most creative, forward-thinking people of the IT field. We are looking for highly-skilled &amp; talented candidates to join our team. We believe in constant growth of individuals complimented by the collective skills of the company as a whole. We have developed a working environment that fosters innovation, creativity and a hunger for constant upgradation of ones skill sets, along with a healthy dose of fun.</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">We encourage our dedicated employees to achieve their personal career goals. The different points of view they bring, leads to superior business solutions for our clients. We proactively capitalize on business and technology opportunities that enable higher levels of performance.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">We believe anyone who is part of our team is an asset. Employees like working here because of the great teamwork and the chance to solve challenging problems. We take both your professional and personal development seriously, supporting you in carving out your own individual career path. We are keen in finding newer and bigger opportunities and Projects for our Team along with numerous and comprehensive tools in place to help them.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">Your goals would be aligned with our overall business goals and values. These goals will guide you through each year and will be documented with your manager who will evaluate and rate your overall performance. This is a key factor in determining any performance bonus and future career opportunities to the employees based on their contribution to the company. We always offered challenging career opportunity to all who wants to work with us.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">LogicSpice has a unique corporate culture that fosters growth of its people &amp; actively support diversity in the workplace. We are committed to ensure that everyone, our clients, our staff, are valued &amp; treated with respect. We have kept the environment at Office with utmost professionalism and with positive feelings.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">Logic Spice is a dynamic IT organization, requiring people who have a long-term view of the future. We operate in an environment where every employee is stimulated to perform at their best.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">Work-life balance, non-working weekends, no stretched working hours and an friendly work environment are few of the many perks of working with us. We offer competitive salaries, excellent benefits and inspired thinking.</p>', 1, 'Career Resources', '<p>Career Resources<br />\r\n<style type="text/css">P { margin-bottom: 0.21cm; }A:link { Career Resources</style></p>', 'Career Resources', '<p><span style="color: rgb(63, 63, 63); font-family: roboto, sans-serif; font-size: 16px;">LogicSpice provides a platform to show the skills of the most creative, forward-thinking people of the IT field. We are looking for highly-skilled &amp; talented candidates to join our team. We believe in constant growth of individuals complimented by the collective skills of the company as a whole. We have developed a working environment that fosters innovation, creativity and a hunger for constant upgradation of ones skill sets, along with a healthy dose of fun.</span></p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">We encourage our dedicated employees to achieve their personal career goals. The different points of view they bring, leads to superior business solutions for our clients. We proactively capitalize on business and technology opportunities that enable higher levels of performance.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">We believe anyone who is part of our team is an asset. Employees like working here because of the great teamwork and the chance to solve challenging problems. We take both your professional and personal development seriously, supporting you in carving out your own individual career path. We are keen in finding newer and bigger opportunities and Projects for our Team along with numerous and comprehensive tools in place to help them.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">Your goals would be aligned with our overall business goals and values. These goals will guide you through each year and will be documented with your manager who will evaluate and rate your overall performance. This is a key factor in determining any performance bonus and future career opportunities to the employees based on their contribution to the company. We always offered challenging career opportunity to all who wants to work with us.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">LogicSpice has a unique corporate culture that fosters growth of its people &amp; actively support diversity in the workplace. We are committed to ensure that everyone, our clients, our staff, are valued &amp; treated with respect. We have kept the environment at Office with utmost professionalism and with positive feelings.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">Logic Spice is a dynamic IT organization, requiring people who have a long-term view of the future. We operate in an environment where every employee is stimulated to perform at their best.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; font-size: 16px; line-height: 26px; color: rgb(63, 63, 63); font-family: roboto, sans-serif;">Work-life balance, non-working weekends, no stretched working hours and an friendly work environment are few of the many perks of working with us. We offer competitive salaries, excellent benefits and inspired thinking.</p>');
